description:
A heapin' helpin' of ranch undressing!
When Vicki inherits a ranch from her uncle, she ends up having to share it with her hayseed cousin, Alex. So begins the sexual manoeuvring as each of them tries to outwit the other in a game of erotic cat-and-mouse. A classic tale of greed, treachery, and raw lust from award-winning director John Leslie.

